(2, 'Footer', '', '<p style="text-align: right;">Powered by</p>\r\n\r\n<p style="text-align: right;"><a href="http://365-Solutions.com">www.365-Solutions.com</a></p>\r\n', 1000, 'footer', 1, 0),
(3, 'Home page - Providing Funding Options', '', '<hr />\n<p style="text-align:center"><strong><span style="font-size:26px"><span style="color:#00FF00">Providing Funding Options for Your Business When&nbsp;Banks Won&#39;t Lend</span></span></strong></p>\n\n<p><span style="font-size:16px"><strong>We make it work&nbsp;for you</strong>.&nbsp;Traditional bank financing offers the promise of longer repayment terms and the potential for lower costs, but banks have made it almost impossible for small businesses to qualify. A traditional business loan from a bank is simply out of reach for most small businesses.</span></p>\n\n<p><span style="font-size:16px"><strong>No personal guarantee needed</strong>.&nbsp;Even if you have perfect credit, you are often required to personally guarantee the loan.</span></p>\n\n<p><span style="font-size:16px"><strong>We make it fast and easy for you</strong>.&nbsp;And the bank loan application, approval and funding process&nbsp;is&nbsp;slow and burdensome, with requirements for extensive financial records. The resulting delays and uncertainty lead to missed opportunities for your business.</span></p>\n\n<p><span style="font-size:16px">Here at&nbsp;<strong><span style="color:#00FF00">Fate</span>Capital</strong>&nbsp;understands that a healthy business needs to have a quick access to capital. When opportunity knocks, your business can&#39;t wait for a traditional bank. <strong>Your business requires a&nbsp;financing&nbsp;option that is available when you need it</strong>. That&#39;s our job and we do the best to help you.</span></p>\n', 1000, 'front_page', 1, 0);
