INSERT INTO `tbl_content` (`id`, `name`, `content`, `url`, `seo_title`, `seo_description`, `seo_keywords`) VALUES
(1, 'FateCapital\n', '<p style="text-align:center"><span style="color:#00FF00"><span style="font-size:24px">Providing Funding Options for Your Business When&nbsp;Banks Won&#39;t Lend</span></span></p>\n\n<p><span style="font-size:16px"><strong>We make it work&nbsp;for you.</strong> Traditional bank financing offers the promise of longer remittance terms and the potential for lower costs, but banks have made it almost impossible for small businesses to qualify. A traditional business loan from a bank is simply out of reach for most small businesses.</span></p>\n\n<p><span style="font-size:16px"><strong>No personal guarantee needed.</strong> Even if you have perfect credit, you are often required to personally guarantee the funding.</span></p>\n\n<p>&nbsp;</p>\n\n<p><span style="font-size:16px"><strong>We make it fast and easy.</strong> And the bank loan application, approval and funding process </span><span style="font-size:16px"><gs class="GINGER_SOFTWARE_mark" ginger_software_uiphraseguid="7a3e44f5-f7f6-4e83-ad6c-4337d132c937" id="b23ca3ed-c3de-40b7-834a-b1a91b68c42f">is</gs></span><span style="font-size:16px"> slow and burdensome, with requirements for extensive financial records. The resulting delays and uncertainty lead to missed opportunities for your business.</span></p>\n\n<p><span style="font-size:16px">Here at <strong><span style="color:#00FF00">Fate</span>Capital</strong></span><span style="font-size:16px"> understands that a healthy business needs to have a quick access to capital. When opportunity knocks, your business can&#39;t wait for a traditional bank. Your business requires a&nbsp;financing&nbsp;option that is available when you need it. That&#39;s our job and we do the best to help you.</span></p>\n\n<p>&nbsp;</p>\n', 'front_page', 'FateCapital\n', 'Providing Funding Options for Your Business When', ''),
(3, 'Contact Us', '<p>Contact Us</p>', 'contact', 'Contact Us', 'Contact ', ''),
(4, 'Business Loans to Help Your Business Grow', '<p style="text-align:center"><span style="font-size:28px"><span style="color:#00FF00"><strong>We Make Business Financing Easy!</strong></span></span></p>\n\n<p style="text-align:left"><span style="font-size:18px">We make applying for a business loan fast and easy. Our clients like how quick the process is and like the method we use to determine approvals for small business loans of $5,000 to $250,000. We get you cash </span><span style="font-size:14px"><span style="font-size:18px">to</span></span><span style="font-size:18px"> your account quickly.</span></p>\n\n<p><span style="font-size:18px">We offer business owners&nbsp; immediate working capital in the form of a cash advance. The great thing about our product is that unlike a bank</span></p>\n\n<ul style="margin-left:35%">\n	<li style="text-align:left"><span style="font-size:18px">There are no personal guarantees for repayment.</span></li>\n	<li style="text-align:left"><span style="font-size:18px">No liens on your home or business.</span></li>\n	<li style="text-align:left"><span style="font-size:18px">No fixed payments.</span></li>\n	<li style="text-align:left"><span style="font-size:18px">It doesn&rsquo;t show on your credit report.</span></li>\n	<li style="text-align:left"><span style="font-size:18px">And we can get the cash </span><span style="font-size:18px">in to</span><span style="font-size:18px"> your bank account in as little as 7 business days.</span></li>\n	<li style="text-align:left"><span style="font-size:18px">And you never have to guarantee a minimum monthly payment!!!</span></li>\n</ul>\n\n<p style="text-align:left">&nbsp;</p>\n', 'business-loans', 'Business Loans', 'Loans ', ''),
(5, 'Merchant Cash Advances & Business Cash Advances', '<p><span style="font-size:18px">Even if you have been denied a small business loan, you may still qualify and be preapproved for a business cash advance in as little as 24 hours. Unlike bank loans, our merchant cash advances provide financing based on future credit card sales.</span></p>\n\n<p><span style="font-size:18px"><span style="color:#00FF00">If your business accepts credit cards and processes at least $4,000/month, qualifying for a business cash advance is easy!</span></span></p>\n\n<p><span style="font-size:18px">When you apply for a merchant cash advance, we review your recent months of debit and credit card processing to determine an approval amount. Then, we advance you capital that you can use for any business expense and pay back through a small, fixed percentage of your future credit card sales. Plus, there is no need to change your credit card processor.</span></p>\n\n<p><span style="font-size:18px">Since the repayment is a fixed percentage, the amount adjusts to the ups and downs of your daily payment card volume. If you have a good day, you pay back more on your advance. If your sales are slow, well, you pay back less. Regardless, you will have enough cash flow to deal with your day-to-day business functions. You can even get additional capital before your advance is paid off!</span></p>\n\n<p><span style="font-size:18px">Getting working capital with a merchant cash advance is easy!</span></p>\n\n<p>&nbsp;</p>\n', 'cash-advanced', 'Cash Advanced', 'Cash Advanced', ''),
(6, 'Applying is Fast & Easy', '<p>Content</p>\r\n', 'how-it-works', 'How It Works', 'How It Works', ''),
(7, 'Privacy Policy', '<p><strong>Web Security/Internet Privacy Policy</strong></p>\n\n<p>FateCapital is committed to protecting your online privacy while providing you with the most useful and enjoyable Web experience possible. We make every effort to carefully manage all our data with the highest standards of integrity and confidentiality. FateCapital and its employees are required to adhere to a strict code of conduct set forth by the company that sets the highest standards of professionalism and ethical conduct.</p>\n\n<p><strong>How we collect and use personal information</strong></p>\n\n<p>We only collect personal information if you elect to give us that information for the purpose of facilitating the activation of your account or to apply for an account via input forms on our website. Your information is only accessible to employees who need to use it to provide you and your company with our products and services. All data is managed and maintained physically and electronically with operational safeguards to ensure your information is protected at all times and through every step of our process.</p>\n\n<p>FateCapital continually monitors its systems, technology and processes and upgrades it frequently to best protect your information.</p>\n\n<p><strong>How we use &ldquo;cookies&rdquo;</strong></p>\n\n<p>As you probably know, &ldquo;cookies&rdquo; are bits and pieces of information that some websites store on your computer&rsquo;s hard drive when you visit them. Like many other websites, www.Fatecapital.com&nbsp;uses cookies to track statistical information about navigation through our site. This cookie does not collect any personal data and we only use the statistical information we collect internally to improve our site. Most Web browsers automatically accept cookies but allow you to modify security settings so you can approve or reject cookies on a case-by-case basis. Even if you do not use cookies, you can still access all of the features on our site.</p>\n\n<p><strong>Minimum Browser Requirements</strong></p>\n\n<p>www.Fatecapital.com supports the Chrome, Firefox, Safari, Internet Explorer, and Opera Internet browsers. Current versions of these browsers as well as the previous 2 versions will be supported by www.Fatecapital.com, and is the minimum Internet browser necessary to properly view and use the FateCapital website (www.Fatecapital.com).</p>\n\n<p><strong>Linkage to External Sites</strong></p>\n\n<p>FateCapital may provide links to third party external websites. If you follow links to these external websites, you should review their privacy policy, as it may be different from ours. FateCapital does not guarantee and is not responsible for the privacy of these third party external websites, or for any information represented in these websites.</p>\n\n<p><strong>Modifications to the Privacy Policy</strong></p>\n\n<p>www.Fatecapital.com reserves the rights to modify its privacy policy at any time and will notify you by posting an amendment to the privacy policy on the web site. Such modifications will become effective on the day they are posted. &nbsp;www.Fatecapital.com encourages you to frequently review the privacy policy for any modifications.</p>\n\n<p>Policy Effective Date: January 1, 2015</p>\n\n<p>For Questions or Comments Regarding Our Privacy Policy, Please Contact FateCapital</p>\n\n<p><span style="font-size:14px">Echo Group Inc</span></p>\n\n<p>4341 Birch Street, Suite 107</p>\n\n<p>Newport Beach, CA 92660</p>\n\n<p>877-227-2471 toll</p>\n\n<p>302-613-0515 phone</p>\n\n<p>302-613-0514 fax</p>\n', 'privacy-policy', 'Privacy Policy', 'Privacy Policy', ''),
(8, 'Terms and Conditions', '<p><strong>Terms &amp; Conditions</strong></p>\r\n\r\n<p>Any applications submitted electronically shall have the same force and effect as if the application bore an inked original signature(s). The above information, together with any accompanying financial statements, schedules, or other materials, is submitted for the purpose of obtaining credit and is warranted to be true, correct, and complete.</p>\r\n\r\n<p><strong>For Loan/Merchant Services:</strong></p>\r\n\r\n<p>The Merchant and Owner<gs class="GINGER_SOFTWARE_mark" ginger_software_uiphraseguid="a5dcd8ac-5948-43c4-83e9-0148cb7ac4e9" id="54387aaf-e51c-4365-93db-4dcfadd74ee7">(</gs>s<gs class="GINGER_SOFTWARE_mark" ginger_software_uiphraseguid="a5dcd8ac-5948-43c4-83e9-0148cb7ac4e9" id="ced90ac9-7596-4cd2-a43d-85a75fed6cc7">)</gs>/Officer<gs class="GINGER_SOFTWARE_mark" ginger_software_uiphraseguid="a5dcd8ac-5948-43c4-83e9-0148cb7ac4e9" id="ceb92adf-db69-434e-9395-95b63d44c267">(</gs>s) identified in the application (individually, an &ldquo;Applicant&rdquo;) each represents, acknowledges and agrees that (1) all information and documents provided to FateCapital, Inc. (&ldquo;NF&rdquo;) including credit card processor statements are true, accurate and complete, (2) Applicant will immediately notify NF of any change in such information or financial condition, (3) Applicant authorizes NF to disclose all information and documents that NF may obtain including credit reports to other persons or entities (collectively, &ldquo;Assignees&rdquo;) that may be involved with or acquire commercial loans having daily repayment features and/or Merchant Cash Advance transactions, including without limitation the application therefor (collectively, &ldquo;Transactions&rdquo;) and each Assignee is authorized to use such information and documents, and share such information and documents with other Assignees, in connection with potential Transactions, (4) each Assignee will rely upon the accuracy and completeness of such information and documents, (5) NF, Assignees, and each of their representatives, successors, assigns and designees (collectively, &ldquo;Recipients&rdquo;) are authorized to request and receive any investigative reports, credit reports, statements from creditors or financial institutions, verification of information, or any other information that a Recipient deems necessary, (6) Applicant waives and releases any claims against Recipients and any information-providers arising from any act or omission relating to the requesting, receiving or release of information, and (7) each Owner/Officer represents that he or she is authorized to sign this form on behalf of Merchant.(8) I consent to receive faxes and e-mails sent by FateCapital and its affiliates for the purposes of transmitting account updates, requests for information and notices, and (9) this request is for business and not for consumer purposes.</p>\r\n\r\n<p><strong><gs class="GINGER_SOFTWARE_mark" ginger_software_uiphraseguid="34a6c651-09bd-4e35-b09f-3b6fff906fba" id="4ee35b42-0dd4-4fc3-a1c9-758380899b01">For</gs> Equipment Services:</strong></p>\r\n\r\n<p>I hereby certify: (1) the information provided is true and correct, (2) you are hereby authorized to investigate all bank, credit, and trade references, and said references are hereby authorized to release any requested information to you or your nominee, (3) such authorization shall extend to obtaining personal credit profile in considering this application and subsequently for the purposes of update, renewal or extension of such credit or additional credit and for reviewing or collecting the resulting account, (4) this information may be transmitted by us to you and by you to underwriter(s) for the purpose of granting me credit, either electronically or manually, and that by submitting this application, I take full responsibility for transmission thereof, (5) I am over 18 years of age, (6) I acknowledge my rights under the Fair Credit Reporting Act, (7) I consent to receive faxes and e-mails sent by FateCapital and its affiliates for the purposes of transmitting account updates, requests for information and notices, and (8) this request is for business and not for consumer purposes.</p>\r\n\r\n<p>The Federal Equal Credit Opportunity Act prohibits creditors from discriminating against credit applicants on the basis of race, color, religion, national origin, sex, marital status or age (provided the applicant has the capacity to enter into the binding contract); because all or part of the applicant&rsquo;s income derives from any public assistance program; or because the applicant has in good faith exercised any right under the Consumer Credit Protection Act. If for any reason your application for business credit is denied, you have the right to a written statement of the specific reasons for the denial. To obtain the statement, please write to FateCapital Inc. <gs class="GINGER_SOFTWARE_mark" ginger_software_uiphraseguid="774e31d0-5ce0-4487-bcd9-e10e11d50411" id="56e807e6-a255-4125-bac2-5deb1e39f664">address</gs> listed below.&nbsp; Funding amount and credit approval is subject to a full credit profile review.</p>\r\n\r\n<p><span style="font-size:14px">Fate Capital LLC</span></p>\r\n\r\n<p>4341 Birch Street, Suite 107</p>\r\n\r\n<p>Newport Beach, CA 92660</p>\r\n\r\n<p>877-227-2471 toll</p>\r\n\r\n<p>302-613-0515 phone</p>\r\n\r\n<p>302-613-0514 fax</p>\r\n', 'terms-and-conditions', 'Terms and Conditions', 'Terms and Conditions', ''),
(9, 'Calculator', '', 'calculator', '', '', ''),
(10, 'How it Works', '', '/page/view/how-it-works', '', '', ''),
