(1, 'Contact Form', 'Contact Fate Capital', '<p><strong>Full Name: </strong>{FULL_NAME}</p>\r\n\r\n<p><strong>Business Legal Name:</strong> {LEGAL_NAME}</p>\r\n\r\n<p><strong>Contact Phone:</strong> {PHONE}</p>\r\n\r\n<p><strong>Email</strong>:&nbsp;{EMAIL}</p>\r\n\r\n<p><strong>Message</strong>:&nbsp;{MESSAGE}</p>\r\n', 'contact_form', '', 1, 1, 1, 'Thank you. Your message was sent successfully.', 'Sorry, your message was not sent. Please, contact us.'),
(2, 'Confirm registration', 'New User - {LOGIN}', '<p>New user has been registred.</p>\n\n<p><strong>Login:</strong> {LOGIN}</p>\n\n<p><strong>Email</strong>: {EMAIL}</p>\n\n<p>To confirm an email address, please click here.</p>\n\n<p>{ACTIVATION_URL}</p>\n\n<p>&nbsp;</p>\n', 'registration', '', 1, 1, 0, 'Thank you for your registration. You will get access after activation of your account.', 'Upon registration error occurred. Please re-register or contact us.'),
(3, 'Password Recovery', 'Request for password recovery', '<p>To reset the password, use the link:<br />\n{PASSWORD_RECOVERY}</p>\n', 'password_recovery', '', 2, 1, 1, 'Please check your email. An instructions was sent to your email address.', ''),
(4, 'User Activation email from admin', 'Activation email', '<p>Hellow {NAME}! You are activated!</p>\n\n<p><strong>Your login</strong> : {LOGIN}</p>\n', 'user_activation', '', 2, 1, 1, 'Activation message successfully sent!', 'Something wrong with sending...'),
(5, 'Calculator Form', 'FateCapital Calculator', '<p><span style="font-size:14px"><strong>Business Legal Name:</strong>&nbsp;{BUSINESS_NAME}</span></p>\n\n<p><span style="font-size:14px"><strong>Your Name:</strong>&nbsp;{CLIENT_NAME}</span></p>\n\n<p><span style="font-size:14px"><strong>Phone:</strong>&nbsp;{PHONE}</span></p>\n\n<p><span style="font-size:14px"><strong>Email:</strong>&nbsp;{EMAIL}</span></p>\n\n<p><span style="font-size:14px"><strong>Business Industry:</strong>&nbsp;{INDUSTRY}</span></p>\n\n<p><span style="font-size:14px"><strong>Years in Business:</strong> {YEARS}</span></p>\n\n<p><span style="font-size:14px"><strong>Monthly Gross:</strong>&nbsp;{TERM}</span></p>\n\n<p><span style="font-size:14px"><strong>Loan Amount:</strong>&nbsp;{LOAN}</span></p>\n', 'calculator_form', '', 1, 1, 1, 'Thank you. Your message was sent successfully.', 'Sorry, your message was not sent. Please, contact us bu the phone: (619) 204-0610.'),
(6, 'Apply Now with FateCapital', 'Apply Now for FateCapital', '<p>Business Legal Name: {BUSINESS_NAME}</p>\r\n\r\n<p>Name of the Client: {CLIENT_NAME}</p>\r\n\r\n<p>Phone: {PHONE}</p>\r\n\r\n<p>Email: {EMAIL}</p>\r\n\r\n<p>Monthly Gross: {GROSS}</p>\r\n\r\n<p>Years in Business: {BUSINESS_YEAR}</p>\r\n\r\n<p>Business Industry: {INDUSTRY}<br />\r\nRequested Loan Amount: {LOAN}<br />\r\n&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'apply_now', '', 1, 1, 1, '', ''),
(7, 'Apply For Business Funding Easy Now', 'Apply For Business Funding Easy Now', '<p>Name: {FULL_NAME}</p>\r\n\r\n<p>Business Legal Name:&nbsp;{LEGAL_NAME}</p>\r\n\r\n<p>Zip Code:&nbsp;{ZIP}</p>\r\n\r\n<p>Contact Phone: {PHONE}</p>\r\n\r\n<p>Email: {EMAIL}</p>\r\n\r\n<p>Monthly Gross: {GROSS}</p>\r\n', 'apply_for', '', 1, 1, 1, '', '');
